🔸 The story: Susan Morrow is a sophisticated art director living a life apparentlyenviable. One day, she sees her line of bitter self-reflection interrupted by the manuscript of herfirst husband, Edward - who hasn’t talked to her in years, much because of the brutal break up aggravated by her not supporting his dream to become a writter.
 This manuscriptstarts by being a policial like every other, but Susan (a lonely night reader) finds herself reliving pastdemons because of the manuscript, that may or not mirror real life...
